import React from 'react';

function Home() {
  return (
    <section id="home">
      <h2>Bienvenue sur mon portfolio</h2>
      <p>Développeur passionné par l'intelligence artificielle, la science des données, et les solutions logicielles innovantes.</p>
    </section>
  );
}

export default Home;
